import React, { Fragment } from 'react';

const Card = (props) => {
    const {name, email, id} = props;
    return(
        <Fragment className="tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5">
            <img src={`https://robohash.org/${props.id}?size=200x200`} alt='robots'/>
            <div>
                <h2>{props.name}</h2>
                <p>{props.email}</p>
            </div>
        </Fragment>
    );
}

export default Card
